                 col.push(fullColorHex(temp, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b === 0) { //Cluster\n                var j = 0;\n                if(data.clusters){\n                    for(i=0;i<len;++i){col.push(colors[1+data.clusters[i]]);}\n                }else{\n                    for(i=0;i<len;++i){col.push(othercol);}\n                }\n                source.data.color = col;\n            }\n            if(b === 3) { //KaKs_Scores\n                max = Math.max(...data.KaKs_Scores)\n                for(i=0;i<len;++i){\n                    // normalizing\n                    temp =  Math.floor(255 * (1 - (data.KaKs_Scores[i] / max)));\n                    col.push(fullColorHex(temp,temp,76))\n                }\n                source.data.color = col;\n            }\n            if(b === 4){ //similarity_scores\n                max = Math.max(...data.similarity_scores)\n                min = Math.min(...data.similarity_scores)\n                console.log(min)\n                for(i=0;i<len;++i) {\n                    temp =  Math.floor(255 * ((data.similarity_scores[i] - min) / (max-min)));\n                    col.push(fullColorHex(temp,temp,76))\n                }\n                data.color = col;\n            }\n            if(b === 5){ //Lengths\n                max = Math.max(...data.lengths)\n                for(i=0;i<len;++i) {\n                    temp =  Math.floor(255 * (1 - (data.lengths[i] / max)));\n                    col.push(fullColorHex(temp, temp, temp));\n                }\n                data.color = col;\n            }\n            if(b===6){ //GC\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.gc[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b===7){ //ECAI\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.ecai[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b===8){ //CAI\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.cai[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            source.change.emit();\n            "},"id":"7cc683e2-a755-4352-a416-1fea461c5578","type":"CustomJS"},{"attributes":{"plot":{"id":"83fe213b-11d0-4df5-a6f1-b4a570b523cb","subtype":"Figure","type":"Plot"},"ticker":{"id":"cfe7ec0a-0049-4957-8da9-58a8e757c549","type":"BasicTicker"}},"id":"56040a4e-7724-4034-8d31-bd0d37c4026e","type":"Grid"},{"attributes":{"callback":null,"tooltips":[["species","@species"],["nan_nb","@nans"],["mean_entr","@meanentropy"],["length","@lengths"],["GCcount","@gc"]]},"id":"d847c78b-d8f8-432d-aa80-f2469af6dcfb","type":"HoverTool"},{"attributes":{},"id":"6f6b72e3-4d8a-4ca4-8f0a-959d9e86e8b3","type":"BasicTickFormatter"},{"attributes":{"active":0,"callback":{"id":"7cc683e2-a755-4352-a416-1fea461c5578","type":"CustomJS"},"labels":["show Cluster","show Doublon","show Nans","show KaKs_Scores","show similarity_scores","show Length","show gc","show ecai","show cai"]},"id":"70d89ce5-bfc4-4c3a-a7a1-691e94ce833f","type":"RadioButtonGroup"},{"attributes":{},"id":"ec2c0bd9-c174-4ba4-8ca2-526f70305633","type":"WheelZoomTool"},{"attributes":{"dimension":1,"plot":{"id":"83fe213b-11d0-4df5-a6f1-b4a570b523cb","subtype":"Figure","type":"Plot"},"ticker":{"id":"ac1fc35e-e1bc-42b5-8faa-43aa385631d7","type":"BasicTicker"}},"id":"2917aa40-479b-42be-a97a-a9a388c687c6","type":"Grid"},{"attributes":{},"id":"fe59ffe7-226b-4a51-b6bc-69c49d1b8bb4","type":"LinearScale"}],"root_ids":["c377bc0b-c294-43d9-9e46-3a52caebb3e7"]},
